import './List.css'
const DiscoList = () => {
  return (
    <div className='ListContainer'>
      <span className='heading'>ToDo List</span>
       <div className="search">
           <input  className='input' type="text" name="" id="" />
       </div>
    </div>
  )
}

export default DiscoList
